import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import { TestPattern, ResourceListItem, ResourceSectionHeader, ResourceList, resourceObjects, Menu } from './main.js';

class App extends Component {
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <TestPattern />
          <ul>
            {ResourceListItem(resourceObjects[1])}
            {ResourceSectionHeader(resourceObjects[2])}
            {ResourceList()}
            {Menu()}
          </ul>
        </header>
      </div>
    );
  }
}

export default App;
